    def getClosestWaypoints(self, location, stepParams, params):
        waypoints=params["waypoints"]
        #startWaypoints = params["closest_waypoints"]
        startWaypoints = stepParams["stepPrevWaypoints"]
        prevClosestDistance = stepParams["stepPrevdistance_closest_waypoint"]
        prevClosestIndex = stepParams["stepPrevclosest_waypoint_index"]
        # print("startWaypoints: ")
        # print(startWaypoints)
        curClosestWaypointIndex = prevClosestIndex
        curSecondClosestWaypointIndex = prevClosestIndex
        curClosestDistance = 100
        for num, waypoint in enumerate(params["waypoints"]):
    #        print("index: "+str(num)+" waypoint: "+str(waypoint)+" location: "+str(location))
            xSQ = abs(waypoint[0]-location[0]) ** 2
            ySQ = abs(waypoint[1]-location[1]) ** 2
            z = math.sqrt((xSQ+ySQ))
    #        print("waypoint distance: "+str(z))
            if z < curClosestDistance:
                curClosestDistance = z
                curSecondClosestWaypointIndex = curClosestWaypointIndex
                curClosestWaypointIndex = num

        print("curClosestWaypointIndex: "+str(curClosestWaypointIndex)+" 2nd closest waypoint "+ str(curSecondClosestWaypointIndex) +" location: "+str(location))

        if (curSecondClosestWaypointIndex == HISTORY.maxWaypointIndex and curClosestWaypointIndex == 0) or (curSecondClosestWaypointIndex == 0 and curClosestWaypointIndex == HISTORY.maxWaypointIndex):
            return [HISTORY.maxWaypointIndex, 0], curClosestDistance, curClosestWaypointIndex
        elif curSecondClosestWaypointIndex >= curClosestWaypointIndex:
            return [curClosestWaypointIndex, curSecondClosestWaypointIndex], curClosestDistance, curClosestWaypointIndex
        else:
            return [curSecondClosestWaypointIndex, curClosestWaypointIndex], curClosestDistance, curClosestWaypointIndex

